INSERT INTO `reportinfra_cierrefalla` VALUES (1,'22319906404','No aplica ya que los productos que tenemos no tienen esa falla','2022-05-05 14:46:13.194033'),(2,'22325648704','Vmware comenta que primero hay que deshabilitar el usuario y posteiormente eliminarlo.','2022-05-06 22:10:29.914539'),(3,'17916111','Se enviaron los logs y Screens con la falla,  estan en analisis por el  proveedor.','2022-06-03 14:17:46.566058'),(4,'185','Problem: ARBUE01P-ESX23: Problem with memory in slot DIMM.Socket.A6/ AMX VCLOUD Se revise error desde iDRAC y el fabricante recomienda un reinicio para corregir error, se aplica reinicio y la falla se corrige. Message Id Message Recommended Action Time Stamp MEM0802 The memory health monitor feature has detected a degradation in the DIMM installed in DIMM_A6. Reboot system to initiate self-heal process. The system memory health must be improved by initiating the self-heal process. To start the process, restart the system.','2022-06-06 16:20:15.369621'),(5,'192','Se realiza el reemplazo de disco duro dañado en MCP-PP01-CL23-ESX011.CLOUDTELMEX.LOCAL bajo el RFC C209034 y la tarea T736423 mediante el SR 5364666085 que se genero al proveedor HP','2022-06-06 17:24:55.811047'),(6,'193','Se genero SR con Huawei para el servidor mxap-npvtp10.cloudmty.local debido a que no se puede alcanzar el iBMC en NPE Mty','2022-06-06 17:27:52.983836'),(7,'185','Durante la revision del error y mitigación del mismo se reviso la recomendación del fabricante:\r\nThe memory health monitor feature has detected a degradation in the DIMM installed in DIMM_A6. Reboot system to initiate self-heal process.\r\nSe procedio al reinicio del equipo y se resolvio el problema.','2022-06-06 18:58:22.286714'),(8,'22352304308','Se agrego más cuota al NFS y con eso se solucionó, además VMware solicita que le demos un reinicio a los servicios de VMware Cloud Director service con el KB https://kb.vmware.com/s/article/1026310','2022-08-09 14:49:24.781583'),(9,'SR148098718','usmia01m-esx02.usa.clarocloud.info	43PL333 	43PL333 - 148098718 - 432258609','2022-09-02 23:07:07.399367'),(10,'SR148098937','usmia01s-esx01	8BBMY23	8BBMY23 - 148098937 - 432258821	VMNIC0 Down','2022-09-02 23:07:35.351675'),(11,'165629659','Aun se continua con el SR abierto ya que se continua con el agregado de switches que no se han  podido agregar.','2023-04-19 19:53:28.122210'),(12,'165629659','Hoy se recibio un procedimineto para agregar los SW Brocade al SCG,sin embargo se tiene que hacer el upgrade a la v9.1.1, actualmente los brocades estan en la v9.0.1b4, se les da respuea a soporte  para saber si se pueden agregar los nodos en esa version o bien programar el upgrade de ambos brocades.','2023-04-19 22:40:49.912425'),(13,'166711415','Se envio correo contestando las preguntas que mandaron al igual se solicito las fechas tentativas para programar la ventana.','2023-04-22 00:15:38.459536');
