M collection error','15/05/2022','','','','2022-06-06 18:15:28.916134',1,2,3,194,4,4,'','','','','',''),(221,'22326956205','El SR se genero para conocer cual es el impacto si se incrementan los dias de retención de los logs en el vRops de AMX\r\nProblema:\r\nSe requiere saber como incrementar los días de retención de los Logs del vRops y que impacto tiene esta modificación en el vCloud.\r\nResolución: \r\nSe recomienda utilizar vRealize Log Insight para aumentar la retención de logs de vROps. \r\nAdicionalmente, no se recomienda incrementar el Global Setting de Symptoms/Alerts a 365 dias por el impacto que puede causar a nivel de la aplicación.\r\nClearing the Alerts and Alarms Tables in vRealize Operations (2123921)\r\nhttps://kb.vmware.com/s/article/2123921\r\nThe cluster suffers performance issues while a high number of historical alerts and/or alarms are present.\r\nIf the Alerts and Alarms tables are large, it\'s recommended to truncate both tables to clear out historical alerts and alarms to avoid cluster performance issues.','05/05/2022','N/A','N/A','N/A','2022-06-06 18:18:56.362432',1,2,3,163,10,4,'','','','','',''),(222,'','One or more virtual machine guest file systems are running out of disk space','11/05/2022','','','IM1580756','2022-06-06 18:19:14.124890',9,2,3,165,7,4,'','','','','',''),(223,'','FALLA REPORTADA NO ESTA RESOLVIENDO POR NOMBRE LOS DNS, RF1446988 DOMINICANA','03/06/2022','','','IM1601927','2022-06-06 18:23:25.183588',12,2,3,161,7,4,'','','','','',''),(224,'22329002605','Saturación de espacio en disco celdas de Cloud Director','12/05/2022','','','IM1578748','2022-06-06 18:23:28.011260',1,2,3,161,4,4,'','','','','',''),(225,'22327527005','El SR se genero para conocer cual es el impacto al incrementan los días de retención de las tareas y eventos del vCenter Server de AMX\r\nProblema:\r\nSe requiere saber como incrementar los días de retención de los Logs del vRops y que impacto tiene esta modificación en el vCloud.\r\nResolución: \r\nSegún la documentación encontrada el valor por default es de 30 días de retención, 180 días es soportado sin ningún problema, sin embargo, no se tiene certeza alguna si el ambiente llegara a tener latencia debido a la cantidad de días, es solo una buena practica mantenerlo en el valor por defecto.\r\nhttps://kb.vmware.com/s/article/59261?lang=en_us\r\nComo bien lo indica la documentación “puede haber latencia en la eliminación de los eventos que son más antiguos que la configuración de retención configurada” no obstante es soportado aumentarla.','06/05/2022','N/A','N/A','N/A','2022-06-06 18:24:34.796330',1,2,3,157,10,4,'','','','','',''),(226,'22328353705','El SR se genero porque no es posible ejecutar los respaldos del SDDC Manager de AMX\r\nProblema:\r\nSe requiere habilitar los respaldos desde el SDDC Manager del vCloud de AMX\r\nResolución:\r\n- The SDDC Manager backup was failing due to an excessive number of log files associated with pantheon, which was taking a long time to export, and then repackage.\r\n- The time taken to export all the files was greater than the timeout configured for handling the SDDC Manager backup.\r\n- The logs were located in the following directory:\r\n/opt/vmware/vcf/pantheon/data/confluent.Y6clgy86/kafka/logs','10/05/2022','N/A','C208603','N/A','2022-06-06 18:30:56.897928',1,2,3,170,10,4,'','','','','',''),(227,'22329149105','Usage Meter SRM collection error','12/05/2022','','','','2022-06-06 18:41:04.286691',1,2,3,194,4,4,'','','','','',''),(228,'','Baja de accesos en ambiente AMX\r\nRENE ALCALDE TAPIA','02/06/2022','','C209032','','2022-06-06 18:57:42.430350',1,2,3,157,6,4,'','','','','',''),(229,'17801066','2288H V5 Unexpected reboot | Site Queretaro.','09/05/2022','','','','2022-06-06 18:58:08.350311',3,2,2,129,16,5,'','','','','',''),(230,'22326544305','mcp-pp01-cl26-esx004 Presenta alerta en Disk Offline vSAN','22/04/2022','','','IM1586504','2022-06-06 19:06:54.512708',3,2,3,160,16,4,'','','','','',''),(231,'22329896905','Certifica