723)\r\nDentro del cluster de vSAN están alojadas todas las VMs de este cluster\r\nvCenter\r\nCluster de VCD (3 celdas)\r\nCluster de vROPs (3 nodos)\r\nCluster de vRLI (3 nodos)\r\nCluster de vROP (2 nodos)\r\nTenant App (1 nodo)\r\n2 cluster NSX-V (uno para mgmt y otro para Payload)\r\nMGMT: 1 manager, 3 controllers, 4 edges para uso de LB y FW\r\nPAYLOAD: 1 manager, 3 controllers, 22 edges de OrgVDCs\r\nCluster de Cassandra (5 nodos, uso para VCD)\r\nCluster de rabbitmq (3 nodos, uso para VCD)\r\nCluser de VCAV\r\n\r\n1 vCenter de Payload - Versión 6.7 u3 (Version 6.7.0 Build 19299595)\r\n2 Cluster de VSAN con 3 hosts esxi cada cluster 6.7 u3 (6.7.0, 19195723)\r\nDentro de estos cluster de vSAN están alojadas todas las VMs existentes en cada cluster\r\nLas VMs que hay dentro de estos 2 cluster son VMs de Organizaciones de VCD, adicional de los edges de cada Organización de vCD.\r\n\r\nLo que nos preocuparía mas o que tenmos mas incertidumbre es sobre los cluster de VSAN, NSX-V, VCD. PEro en general quisieramos de su apoyo para en caso de tener que apagar todo nos indiquen el proceso de cada cluster y el orden ó las implicaciones de dejar todo encendido y no perder algun tipo de data o tener inconsistencias sobre todo a nivel vSAN.','30/09/2022','','','','2022-10-04 23:06:25.189218',4,2,3,160,8,4,'','','','','',''),(371,'22366981009','Reemplazo de switches fisicos - vCenter\r\n\r\nSe realizara un reemplazo de 2 switches fisicos simultaneamente, a estos switches estan conectados los host que forman el cluster de vSAN, asi como diversos clusters de vROPs, vRLI, NSX-V.\r\n\r\nLa consulta es saber como podemos realizar el proceso de reemplazo sin afectar la infraestructura. Si es necesario apagar, cual seria el procedimiento correcto para realizarlo?”','28/09/2022','','','','2022-10-04 23:07:59.386081',4,2,3,157,8,4,'','','','','',''),(372,'22367654509','Reemplazo de infrastructura fisica (Switches) - VCD\r\n\r\nHace referencia a la descripcion del SR 22367652009','30